package ArrayListTest;

import java.util.Scanner;

public class NextIntTest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		while(true) {
			int num;
			num = sc.nextInt();
			sc.nextLine();
			System.out.println(num);
		}
	}

}
